import React from "react";

function About() {
  return (
    <div className="about">
      <div class="container">
        <div class="row align-items-center my-5">
          <div class="col-lg-7">
          </div>
          <div class="col-lg-5">
            <h1 class="font-weight-light">About</h1>
            <p>
              Some info about us and professor marvin
            </p>
          </div>
        </div>
      </div>
    </div>
  );
}

export default About;
